function getFinishDate(ends, dateFormat) {
    moment.locale('es');
    if (dateFormat == 'day') {
        return moment().add(ends, dateFormat).format('DD MMMM YYYY');
    } else if (dateFormat == 'week') {
        return moment().add(ends, dateFormat).format('DD MMMM YYYY');
    }
    return moment().add(ends, dateFormat).format('MMMM YYYY');

}

